	fmt.Println("Xavier starts from P towards Q at a speed of", xavierStartsFromQ, "kmph")
	fmt.Println("Xavier increases his speed by", xavierIncreasesSpeedBy, "kmph every", xavierIncreasesSpeedEvery, "mins")

	// Use brief comments to explain what comparison you do between the defined variables
	// Check if the hypothesis value contradicts the estimate of more than 'xavierStartsFromP'
	if xavierStartsFromQ <= xavierStartsFromP {
