		fmt.Println("The hypothesis value contradicts the calculated value of", totalDistance, "km")
	} else {
		fmt.Println("The hypothesis value does not contradict the calculated value of", totalDistance, "km")
	}

	if xavierIncreasesSpeedEvery == timeTaken {
		fmt.Println("The hypothesis value contradicts the calculated value of", timeTaken, "mins")
	} else {
		fmt.Println("The hypothesis value does not contradict the calculated value of", timeTaken, "mins")
	}

	// Infer entailment, contradiction or neutral relation
	if xavierStartsFromQ == totalDistance && xavierIncreasesSpeedEvery == timeTaken {
		fmt.Println("The hypothesis is entailed by the premise")
	} else if xavierStartsFromQ!= totalDistance || xavierIncreasesSpeedEvery!= timeTaken {
