)

func main() {
	// Define variables for the premise and hypothesis
	premise := "The product of all the possible units digits of Sophie Germain primes greater than more than 8 is."
	hypothesis := "The product of all the possible units digits of Sophie Germain primes greater than 9 is."

	// Extract the numerical entities from the premise and hypothesis
	premiseNum := extractNum(premise)
	hypothesisNum := extractNum(hypothesis)

	// Compare the numerical entities
	if premiseNum > hypothesisNum {
		fmt.Println("contradiction")
	} else if premiseNum < hypothesisNum {
		fmt.Println("entailment")
	} else {
		fmt.Println("neutral")
	}
}

func extractNum(str string) int {
	// Extract the numerical entities from the string
	num := 0
	for _, c := range str {
		if c >= '0' && c <= '9' {
			num = num*10 + int(c-'0')
		}
	}
	return num
}

